function Home() {
  return (
    <div>
      <Header/>
        <div className="centerhome">
          <h1>Ŧєʟɪᴘє ʂᴜɢɪʂᴀᴡᴀ®</h1>


          <h2>s̢̟̦̮̩̱̖͖͇̟̤̬y̢̯̲̫̗̠͖̝͕̗s̢͕̘͍̝̜͇ţ̟̤͚̠̞̠ͅḙ̭̭͚̤̪̞̩͢m̧̩͍͍̘̗͈ d̢̜͖̝̳͎̰̲̦̗̜͚͎ȩ̮͎̦̯̗̙̮̟̖̪v̢͈̜̱̗̰̠̠͚̥̯e̡̪͉͎͉ͅl̪͚̮̱̫͜o̡͓̟͈͚̩̳̰͓̘p̪̙͓̠͢ȩ̮̬̮̞͉̯̙͎̥̠ŗ̰̖̣̦̲̠͚ͅ </h2>
        </div>
